import React, { useEffect, useState } from "react";
import Nav from "../NavBar/Nav";
import "./Login.css";
// import { useNavigate } from "react-router-dom";
import { TextField, Button } from "@mui/material";

const Login = () => {
  const [password, setPassword] = useState("");
  const [email, setEmail] = useState("");

  const handleLogin = () => {
    console.log(email, password);
  };

  return (
    <>
      <Nav />
      <div className="signupBody">
        <div className="heading-box">
          <h1 className="heading">Login...</h1>
        </div>
        <div
          style={{
            margin: ["40", "auto"],
            width: "70%",
            color: "white",
            background: "grey",
          }}
        >
          <TextField
            style={{ marginTop: 20 }}
            label="Enter Email"
            fullWidth
            color="primary"
            variant="filled"
            size="small"
            value={email}
            required
            onChange={(e) => setEmail(e.target.value)}
          />
        </div>
        <div style={{ margin: ["40", "auto"], width: "70%" }}>
          <TextField
            style={{ marginTop: 20 }}
            label="Password"
            type="password"
            fullWidth
            color="primary"
            variant="filled"
            size="small"
            value={password}
            required
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <Button
          variant="standard"
          style={{
            margin: 20,
            background: "#282c34",
            color: "white",
            width: "50%",
          }}
          type="button"
          onClick={handleLogin}
        >
          Login
        </Button>
      </div>
    </>
  );
};

export default Login;
